@section('scripts')
<script>
    
    $('.logout').click(function(){
      app.dialog.confirm('Do you want to continue?',function(){
        document.getElementById('logout-form').submit();
      });
    });

    app.request({
      url : "{{url('/get-waybills')}}",
      method : "GET",
      beforeSend: function(xhr){
        app.progressbar.show('multi');
      },
      success: function(data,status,xhr){
       var obj = JSON.parse(data);
       var pending = obj['pending'];
       var transacted = obj['transacted'];
       var length = pending.length>=5 ? 5 : pending.length;
       var content = '';
       for(var i = 0;i<length;i++){
         color = pending[i]['booking_status']==0 ? 'orange' : 'blue';
         status = pending[i]['booking_status']==0 ? 'PENDING' : 'TRANSACTED';
         var payment_type = pending[i]['payment_type']=="CI" ? "Prepaid" : "Collect";
         content = content + '<li class="swipeout" id="'+pending[i]['reference_no']+'">'+
                   '<div class="swipeout-content">'+
                   '<a href="#" class="item-link item-content">'+
                   '<div class="item-media">'+
                   '<i class="icon f7-icons">qrcode</i>'+
                   '</div>'+
                   '<div class="item-inner">'+
                   '<div class="item-title-row">'+
                   '<div class="item-title">'+pending[i]['reference_no']+'</div>'+
                   '<div class="item-after"><span class="badge color-'+color+'">'+status+'</span></div>'+
                   '</div>'+
                   '<div class="item-subtitle">'+pending[i]['shipper']['fileas']+'-'+pending[i]['consignee']['fileas']+'</div>'+
                   '<div class="item-text">'+payment_type+' | '+pending[i]['transactiondate']+'<br>Destination : <b></b></div>'+
                   '</div>'+
                   '</a>'+
                   '</div>'+
                   '<div class="swipeout-actions-left">'+
                   '<a href="'+"{{url('/waybills')}}/"+pending[i]['reference_no']+'" class="color-blue swipeout-overswipe external">View</a>'+
                   '</div>'+
                   '<div class="swipeout-actions-right">'+
                   '<a href="'+"{{url('/waybills')}}"+'/'+pending[i]['reference_no']+'/edit" class="color-orange external">Update</a>'+
                   '<a href="#" data-confirm="Are you sure you want to delete this item?" class="swipeout-delete swipeout-overswipe" id="'+pending[i]['reference_no']+'" >Delete</a>'+
                   '</div>'+
                   '</li>';
       }
       $('.transaction-list > ul').empty()
       $('.transaction-list > ul').append(content);
      },
      complete: function(xhr,status){
        if(status==200){
          app.progressbar.hide();
        }
      }
    })

    app.on('swipeoutDeleted',function(e)
        {
            app.request({
                url : "{{url('/waybills')}}/"+e.id,
                method : "DELETE",
                data : { _token : "{{csrf_token()}}", reference_no : e.id},
                beforeSend: function(xhr){
                    app.dialog.progress('Cancelling transaction..');
                },
                success: function(data,status,xhr){
                  if(status==200){
                    app.dialog.close();
                    var toastBottom = app.toast.create({
                      icon: '<i class="icons f7-icons">cart_badge_minus</i>',
                      text: 'Booking has been deleted',
                      position: 'center',
                      closeTimeout: 3000,
                    });
                    toastBottom.open();
                  }
                },
                error: function(xhr,status){
                  app.dialog.close();
                  var toastBottom = app.toast.create({
                      icon: '<i class="icons f7-icons">exclamationmark_triangle</i>',
                      text: 'Server connection error',
                      position: 'center',
                      closeTimeout: 3000,
                  });
                  toastBottom.open();
                },
                complete: function(xhr,status){
                  if(status==200){
                    app.dialog.close();
                  }
                }
                  
            })
        });
</script>
@endsection